import React, { Component } from 'react'
import { style_mapping } from "../../styled";

const {
    layout: { ContentArea },
    profile: {
      ProfileHeaderContainer,
      ProfilePicture,
      ProfileResume,
      ProfileHeaderTop,
      ProfileHeaderBottom,
      ProfileLinks,
      ProfileName,
      ProfileCommands
    },
    shared: { Button }
} = style_mapping;

class ProfileContent extends Component {
  render() {
    return (
      <BackgroundColor color="#f4f2f2;">
        <ContentArea>
          <Grid>
            <ProfileSidebar />
            <ProfileMain />
          </Grid>
        </ContentArea>
      </BackgroundColor>
    )
  }
}

export default ProfileContent
